import all from "everyday-fun";

const Getquote = () => {
  let quote = all.getRandomQuote();
  return (<>
    <p className="text-sm text-orange-500 font-cursive">{quote.quote}</p><br />
    <i className="text-sm font-extralight text-right font-serif text-pink-300 underline capitalize">{quote.author}</i>
 </> );
};

function App() {
  return (
    <div className="bg-gradient-to-br from-slate-900 to-wetAsphalt text-slate-100 text-center">
      <header className="App-header">
        <h3>Inspirational Quotes</h3><br /><br />
      </header>
      <Getquote /><br />
      <Getquote /><br />
      <Getquote /><br />
      <Getquote /><br />
      <Getquote /><br />
    </div>
  );
}

export default App;
